import React from "react";
import Auth from "../../components/Auth";

const ResetPassword =()=>{
    return(
        <Auth title="Reset password">
            <p>
                Enter your registered email for this account.A password reset
                link will be sent to the email 
            </p>
        </Auth>
    )
}
export default ResetPassword;
